import { useState } from "react";
import { Modal } from "react-bootstrap";


const WorkoutCreateModal = () => {

    const [modalState, setModalState] = useState(false);
    const handleSubmit = () => {
        setModalState()
    }
    return(
    
        <Modal>
   
           
            <Modal.Header>Header modal</Modal.Header>
            <div>
                Successfully added workout for user !!!
            </div>
            <button type="submit" onClick={handleSubmit}>Close Modal</button>
        </Modal>

    );

}


export default WorkoutCreateModal;
